import React from "react";

import searchButton from '../../img/icon-4.svg';
import vector3 from '../../img/vector-3.svg';
import Locations from './Locations';
import SidePanel from './SidePanel';
import { Component } from "../../components/Component";

const Panel = ({ text }) => (

  <div className="relative w-[142px] h-[47px]">
    <div className="relative w-[140px] h-[47px] bg-[#d9d9d940] rounded-[23.5px]">
      <img className="h-1.5 top-[22px] left-28 absolute w-[11px]" alt="Vector" src={vector3} />
      <div className="absolute h-6 top-3 left-5 text-[#2a2a33] text-sm font-light">
        {text}
      </div>
    </div>
  </div>
);

export const CompareProperty = () => {
  return (
    <div className="bg-white flex flex-row justify-center w-full">
      <div className="bg-white w-[1440px] h-[3568px] relative">
        {/*pull data*/}
        <Component
          className="!border-[unset] !border-[unset] !absolute !left-[1287px] !top-[30px]"
          property1="group-30"
          pullDataClassName="!left-[34px] !top-[15px]"
        />

        saved searches
        <div className="inline-flex items-end gap-[23px] absolute top-[186px] left-[1090px]">
          <div className="inline-flex items-center gap-3 relative flex-[0_0_auto]">
            <div className="relative w-[45px] h-6 bg-ash rounded-[100px]">
              <div className="relative w-5 h-5 top-0.5 left-0.5 bg-generalwhite rounded-[100px]" />
            </div>
            <div className="relative w-fit [font-family:'Poppins',Helvetica] font-medium text-black text-base tracking-[0] leading-[19.7px] whitespace-nowrap">
              Saved Searches
            </div>
          </div>
          <div className="inline-flex items-center gap-[11px] relative flex-[0_0_auto]">
            <div className="relative w-[26px] h-[26px] bg-white rounded-[3px] border border-solid border-[#00000042] shadow-[0px_2.62px_13.1px_#0000001f]" />
            <div className="relative w-fit [font-family:'Poppins',Helvetica] font-medium text-black text-base tracking-[0] leading-[19.7px] whitespace-nowrap">
              Select All
            </div>
          </div>
        </div>

        {/* Search bar */}
        <div className="absolute w-[1012px] h-[47px] top-[103px] left-[397px]">
          <div className="relative w-[236px] h-[47px] bg-[#f6f6fa] rounded-[23.5px] flex items-center">
            <input
              className="w-full h-full pl-6 bg-transparent border-none text-black text-xs font-normal"
              placeholder="Search..."
            />
            <img className="w-[18px] h-[18px] mr-6" alt="Search Icon" src={searchButton} />
          </div>


          <div className="flex w-[768px] h-[47px] items-center gap-[11px] absolute top-0 left-[244px]">
            {['Amenities', 'Square Feet', 'Leasing End Date Range', 'Listing Type', 'save'].map((text, idx) => (
              <Panel key={idx} text={text} />
            ))}
          </div>
        </div>

        {/* Title */}
        <div className="absolute top-[29px] left-[397px] text-black text-[32px] font-semibold bg-white">
          Search & Compare
        </div>

        {/* Location listings */}
        <div className="absolute top-[188px] left-[397px] text-base font-semibold text-black">
          Madison Seattle Rental Listings
        </div>

        {/* Locations */}
        <div className="flex flex-col w-[1013px] items-center gap-[31px] absolute top-[216px] left-[397px]">
          <Locations />
        </div>

        {/* Sidebar */}
        <SidePanel />
      </div>
    </div>
  );
};
